Ninja Nun
Sister Sasuki and a Magic Priest host a Shinto priestess at their church in the hopes of acquiring information about the various spirit incarnations in Japan that do not exist in the Western world.

Smooth Like Lemonade
Demon Foster has put out a hit contract for ten million dollars on Sister Shannon. Doughboy has decided to collect the bounty, but no one ever said killing a Warrior Nun was easy.

Nun Sequitur
Areala's in over her head! It's Shotgun Mary to the rescue...if only she can get herself up out of bed.

